import React from 'react'
import './Footer.css'


export default function Footer() {

  return (
    <div
      className='text-light bg-dark'
    >
      <div className='container-fluid p-3'>
        <p className='p-0 m-0'>Home Services - &copy; 2025</p>
      </div>
    </div>
  )
}
